import React, { useState, useEffect, useContext } from 'react';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';
import { AuthContext } from '../context/AuthContext';
import './AdminDashboard.css';

const AdminDashboard = () => {
  const { logout } = useContext(AuthContext);
  const navigate = useNavigate();
  const [activeTab, setActiveTab] = useState('overview');
  const [bookings, setBookings] = useState([]);
  const [cars, setCars] = useState([]);
  const [loading, setLoading] = useState(true);
  const [showCarForm, setShowCarForm] = useState(false);
  const [editingCar, setEditingCar] = useState(null);

  const handleLogout = () => {
    logout();
    navigate('/');
  };

  const [carFormData, setCarFormData] = useState({
    name: '',
    brand: '',
    model: '',
    year: new Date().getFullYear(),
    pricePerDay: '',
    price30min: '',
    price60min: '',
    currency: 'AED',
    seats: '',
    transmission: 'Automatic',
    fuelType: 'Petrol',
    image: '',
    description: '',
    available: true
  });

  useEffect(() => {
    fetchBookings();
    fetchCars();
  }, []);

  useEffect(() => {
    if (activeTab === 'bookings') {
      fetchBookings();
    } else if (activeTab === 'cars') {
      fetchCars();
    }
  }, [activeTab]);

  const fetchBookings = async () => {
    try {
      setLoading(true);
      const response = await axios.get('/api/admin/bookings');
      setBookings(response.data);
    } catch (error) {
      console.error('Error fetching bookings:', error);
    } finally {
      setLoading(false);
    }
  };

  const fetchCars = async () => {
    try {
      setLoading(true);
      const response = await axios.get('/api/cars');
      setCars(response.data);
    } catch (error) {
      console.error('Error fetching cars:', error);
    } finally {
      setLoading(false);
    }
  };

  const handleCarFormChange = (e) => {
    const { name, value, type, checked } = e.target;
    setCarFormData({
      ...carFormData,
      [name]: type === 'checkbox' ? checked : value
    });
  };

  const handleCarSubmit = async (e) => {
    e.preventDefault();
    try {
      if (editingCar) {
        await axios.put(`/api/admin/cars/${editingCar._id}`, carFormData);
      } else {
        await axios.post('/api/admin/cars', carFormData);
      }
      setShowCarForm(false);
      setEditingCar(null);
      setCarFormData({
        name: '',
        brand: '',
        model: '',
        year: new Date().getFullYear(),
        pricePerDay: '',
        seats: '',
        transmission: 'Automatic',
        fuelType: 'Petrol',
        image: '',
        description: '',
        available: true
      });
      fetchCars();
    } catch (error) {
      alert(error.response?.data?.message || 'Failed to save car');
    }
  };

  const handleEditCar = (car) => {
    setEditingCar(car);
    setCarFormData({
      name: car.name,
      brand: car.brand,
      model: car.model,
      year: car.year,
      pricePerDay: car.pricePerDay,
      price30min: car.price30min || '',
      price60min: car.price60min || '',
      currency: car.currency || 'AED',
      seats: car.seats,
      transmission: car.transmission,
      fuelType: car.fuelType,
      image: car.image,
      description: car.description || '',
      available: car.available
    });
    setShowCarForm(true);
  };

  const handleDeleteCar = async (carId) => {
    if (!window.confirm('Are you sure you want to delete this car?')) {
      return;
    }
    try {
      await axios.delete(`/api/admin/cars/${carId}`);
      fetchCars();
    } catch (error) {
      alert(error.response?.data?.message || 'Failed to delete car');
    }
  };

  const handleUpdateBookingStatus = async (bookingId, status) => {
    try {
      await axios.put(`/api/admin/bookings/${bookingId}/status`, { status });
      fetchBookings();
    } catch (error) {
      alert(error.response?.data?.message || 'Failed to update status');
    }
  };

  const handleCancelBooking = async (bookingId) => {
    if (!window.confirm('Are you sure you want to cancel this booking?')) {
      return;
    }
    try {
      await axios.put(`/api/bookings/${bookingId}/cancel`);
      fetchBookings();
    } catch (error) {
      alert(error.response?.data?.message || 'Failed to cancel booking');
    }
  };

  // Calculate stats
  const activeBookings = bookings.filter(b => 
    b.status === 'pending' || b.status === 'confirmed'
  );
  const bookedCarIds = [...new Set(activeBookings.map(b => b.car?._id?.toString()).filter(Boolean))];

  const stats = {
    totalCars: cars.length,
    availableCars: cars.filter(car => !bookedCarIds.includes(car._id.toString())).length,
    bookedCars: bookedCarIds.length,
    totalBookings: bookings.length,
    pendingBookings: bookings.filter(b => b.status === 'pending').length,
    confirmedBookings: bookings.filter(b => b.status === 'confirmed').length,
    cancelledBookings: bookings.filter(b => b.status === 'cancelled').length,
    completedBookings: bookings.filter(b => b.status === 'completed').length,
    totalRevenue: bookings
