                          className="bar-column bar-cancelled" 
                          style={{ height: `${stats.totalBookings > 0 ? (stats.cancelledBookings / Math.max(stats.pendingBookings, stats.confirmedBookings, stats.cancelledBookings, stats.completedBookings, 1)) * 100 : 0}%` }}
                        >
                          <span className="bar-count">{stats.cancelledBookings}</span>
                        </div>
                      </div>
                      <div className="bar-label">Cancelled</div>
                    </div>
                    <div className="bar-item">
                      <div className="bar-column-wrapper">
                        <div 
                          className="bar-column bar-completed" 
                          style={{ height: `${stats.totalBookings > 0 ? (stats.completedBookings / Math.max(stats.pendingBookings, stats.confirmedBookings, stats.cancelledBookings, stats.completedBookings, 1)) * 100 : 0}%` }}
                        >
                          <span className="bar-count">{stats.completedBookings}</span>
                        </div>
                      </div>
                      <div className="bar-label">Completed</div>
                    </div>
                  </div>
                </div>
              </div>

              {/* Pie Chart - Booking Status Distribution */}
              <div className="chart-card">
                <h3> Booking Status - Pie Chart</h3>
                <div className="pie-chart-container">
                  <div className="pie-chart-wrapper">
                    <svg className="pie-chart" viewBox="0 0 200 200">
                      {(() => {
                        const total = stats.totalBookings || 1;
                        const pendingPercent = (stats.pendingBookings / total) * 100;
                        const confirmedPercent = (stats.confirmedBookings / total) * 100;
                        const cancelledPercent = (stats.cancelledBookings / total) * 100;
                        const completedPercent = (stats.completedBookings / total) * 100;

                        let currentPercent = 0;
                        const radius = 80;
                        const centerX = 100;
                        const centerY = 100;

                        const createArc = (percent, color) => {
                          if (percent === 0) return null;
                          const startAngle = (currentPercent / 100) * 360 - 90;
                          const endAngle = ((currentPercent + percent) / 100) * 360 - 90;
                          currentPercent += percent;

                          const startAngleRad = (startAngle * Math.PI) / 180;
                          const endAngleRad = (endAngle * Math.PI) / 180;

                          const x1 = centerX + radius * Math.cos(startAngleRad);
                          const y1 = centerY + radius * Math.sin(startAngleRad);
                          const x2 = centerX + radius * Math.cos(endAngleRad);
                          const y2 = centerY + radius * Math.sin(endAngleRad);

                          const largeArcFlag = percent > 50 ? 1 : 0;

                          return (
                            <path
                              d={`M ${centerX} ${centerY} L ${x1} ${y1} A ${radius} ${radius} 0 ${largeArcFlag} 1 ${x2} ${y2} Z`}
                              fill={color}
                              stroke="#fff"
                              strokeWidth="2"
                            />
                          );
                        };

                        return (
                          <>
                            {createArc(pendingPercent, '#ff6b35')}
                            {createArc(confirmedPercent, '#28a745')}
                            {createArc(cancelledPercent, '#dc3545')}
                            {createArc(completedPercent, '#17a2b8')}
                          </>
                        );
                      })()}
                      <circle cx="100" cy="100" r="60" fill="white" />
                      <text x="100" y="95" textAnchor="middle" fontSize="20" fontWeight="700" fill="#1e3c72">
                        {stats.totalBookings}
                      </text>
                      <text x="100" y="115" textAnchor="middle" fontSize="12" fill="#666">
                        Total
                      </text>
                    </svg>
                  </div>
                  <div className="pie-legend">
                    <div className="legend-item">
                      <span className="legend-color" style={{background: '#ff6b35'}}></span>
                      <span className="legend-label">Pending ({stats.pendingBookings})</span>
                    </div>
                    <div className="legend-item">
                      <span className="legend-color" style={{background: '#28a745'}}></span>
                      <span className="legend-label">Confirmed ({stats.confirmedBookings})</span>
                    </div>
                    <div className="legend-item">
                      <span className="legend-color" style={{background: '#dc3545'}}></span>
                      <span className="legend-label">Cancelled ({stats.cancelledBookings})</span>
                    </div>
                    <div className="legend-item">
                      <span className="legend-color" style={{background: '#17a2b8'}}></span>
                      <span className="legend-label">Completed ({stats.completedBookings})</span>
                    </div>
                  </div>
                </div>
              </div>

              {/* Bar Chart - Vehicle Status */}
              <div className="chart-card">
                <h3> Vehicle Status - Bar Chart</h3>
                <div className="bar-chart-container">
                  <div className="bar-chart">
                    <div className="bar-item">
                      <div className="bar-column-wrapper">
                        <div 
                          className="bar-column bar-success" 
                          style={{ height: `${stats.totalCars > 0 ? (stats.availableCars / Math.max(stats.availableCars, stats.bookedCars, 1)) * 100 : 0}%` }}
                        >
                          <span className="bar-count">{stats.availableCars}</span>
                        </div>
                      </div>
                      <div className="bar-label">Available</div>
                    </div>
                    <div className="bar-item">
                      <div className="bar-column-wrapper">
                        <div 
                          className="bar-column bar-warning" 
                          style={{ height: `${stats.totalCars > 0 ? (stats.bookedCars / Math.max(stats.availableCars, stats.bookedCars, 1)) * 100 : 0}%` }}
                        >
                          <span className="bar-count">{stats.bookedCars}</span>
                        </div>
                      </div>
                      <div className="bar-label">Booked</div>
                    </div>
                  </div>
                </div>
              </div>

              {/* Pie Chart - Vehicle Status */}
              <div className="chart-card">
                <h3> Vehicle Status - Pie Chart</h3>
                <div className="pie-chart-container">
                  <div className="pie-chart-wrapper">
                    <svg className="pie-chart" viewBox="0 0 200 200">
                      {(() => {
                        const total = stats.totalCars || 1;
                        const availablePercent = (stats.availableCars / total) * 100;
                        const bookedPercent = (stats.bookedCars / total) * 100;

                        let currentPercent = 0;
                        const radius = 80;
                        const centerX = 100;
                        const centerY = 100;

                        const createArc = (percent, color) => {
                          if (percent === 0) return null;
                          const startAngle = (currentPercent / 100) * 360 - 90;
                          const endAngle = ((currentPercent + percent) / 100) * 360 - 90;
                          currentPercent += percent;

                          const startAngleRad = (startAngle * Math.PI) / 180;
                          const endAngleRad = (endAngle * Math.PI) / 180;

                          const x1 = centerX + radius * Math.cos(startAngleRad);
                          const y1 = centerY + radius * Math.sin(startAngleRad);
                          const x2 = centerX + radius * Math.cos(endAngleRad);
                          const y2 = centerY + radius * Math.sin(endAngleRad);

                          const largeArcFlag = percent > 50 ? 1 : 0;

                          return (
                            <path
                              d={`M ${centerX} ${centerY} L ${x1} ${y1} A ${radius} ${radius} 0 ${largeArcFlag} 1 ${x2} ${y2} Z`}
                              fill={color}
                              stroke="#fff"
                              strokeWidth="2"
                            />
                          );
                        };

                        return (
                          <>
                            {createArc(availablePercent, '#28a745')}
                            {createArc(bookedPercent, '#ffc107')}
                          </>
                        );
                      })()}
                      <circle cx="100" cy="100" r="60" fill="white" />
                      <text x="100" y="95" textAnchor="middle" fontSize="20" fontWeight="700" fill="#1e3c72">
                        {stats.totalCars}
                      </text>
                      <text x="100" y="115" textAnchor="middle" fontSize="12" fill="#666">
                        Total
                      </text>
                    </svg>
                  </div>
                  <div className="pie-legend">
                    <div className="legend-item">
                      <span className="legend-color" style={{background: '#28a745'}}></span>
                      <span className="legend-label">Available ({stats.availableCars})</span>
                    </div>
                    <div className="legend-item">
                      <span className="legend-color" style={{background: '#ffc107'}}></span>
                      <span className="legend-label">Booked ({stats.bookedCars})</span>
                    </div>
                  </div>
                </div>
              </div>
            </div>
          </div>
        )}

        {activeTab === 'bookings' && (
          <div className="admin-section">
            <div className="section-header-bookings">
              <h2>All Bookings ({bookings.length})</h2>
              <p>Manage and track all vehicle bookings</p>
            </div>
            {loading ? (
              <div className="loading">Loading bookings...</div>
            ) : (
              <div className="bookings-table">
                {bookings.length === 0 ? (
                  <div className="no-bookings">
                    <svg viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" style={{width: '60px', height: '60px', color: '#ccc', marginBottom: '20px'}}>
                      <path d="M9 5H7C5.89543 5 5 5.89543 5 7V19C5 20.1046 5.89543 21 7 21H17C18.1046 21 19 20.1046 19 19V7C19 5.89543 18.1046 5 17 5H15M9 5C9 6.10457 9.89543 7 11 7H13C14.1046 7 15 6.10457 15 5M9 5C9 3.89543 9.89543 3 11 3H13C14.1046 3 15 3.89543 15 5M12 12H15M12 16H15M9 12H9.01M9 16H9.01"/>
                    </svg>
                    <p>No bookings found.</p>
                    <p style={{color: '#999', fontSize: '14px'}}>Bookings will appear here once customers make reservations.</p>
                  </div>
                ) : (
                  bookings.map((booking) => {
                    if (!booking.car) {
                      return null;
                    }
                    const customerName = booking.customerName || booking.user?.name || 'Guest';
                    const customerEmail = booking.customerEmail || booking.user?.email || 'N/A';
                    return (
                      <div key={booking._id} className="booking-row">
